import { BrowserRouter as Router,Switch } from "react-router-dom";
import "./App.css";
import Navbar from "./Components/Navbar";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch><Navbar /></Switch>

      </Router>
    </div>
  );
}

export default App;
